import React, { useState, useEffect } from 'react';
import { GoogleOAuthProvider } from '@react-oauth/google';
import { Routes, Route, Navigate } from 'react-router-dom';
import GoogleLogin from './components/GoogleLogin';
import Header from './components/Header';
import MealTracker from './components/MealTracker';
import Calculator from './components/Calculator';
import { useTheme } from './context/ThemeContext';
import { NutritionProvider } from './context/NutritionContext';
import { Link } from 'react-router-dom';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [dailyMeals, setDailyMeals] = useState([]);
  const { darkMode } = useTheme();

  useEffect(() => {
    // Check if user is authenticated
    const token = localStorage.getItem('token');
    if (token) {
      setIsAuthenticated(true);
    }
  }, []);

  const handleLoginSuccess = (response) => {
    console.log('Login successful:', response);
    setIsAuthenticated(true);
  };

  const handleAddMeal = (newMeal) => {
    setDailyMeals(prev => [...prev, newMeal]);
  };

  const handleRemoveMeal = (mealIndex) => {
    setDailyMeals(prev => prev.filter((_, index) => index !== mealIndex));
  };

  // Protected Route component
  const ProtectedRoute = ({ children }) => {
    const token = localStorage.getItem('token');
    if (!token) {
      return <Navigate to="/login" />;
    }
    return children;
  };

  if (!isAuthenticated) {
    return (
      <GoogleOAuthProvider clientId="591276305061-4b3vrn5921v0770c45kvsbb739gb6i1v.apps.googleusercontent.com">
        <div className={`min-h-screen ${darkMode ? 'bg-gray-900' : 'bg-gray-50'} transition-colors duration-200`}>
          <nav className={`${darkMode ? 'bg-gray-800' : 'bg-white'} shadow-sm`}>
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-4 flex justify-between items-center">
              <h1 className={`text-xl font-semibold ${darkMode ? 'text-white' : 'text-gray-800'}`}>Vegan Meal Prep</h1>
            </div>
          </nav>
          <main className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
            <div className="flex flex-col items-center justify-center min-h-[80vh] space-y-12">
              {/* Hero Section */}
              <div className="text-center space-y-6 max-w-3xl">
                <h2 className={`text-4xl sm:text-5xl font-bold mb-8 ${darkMode ? 'text-white' : 'text-gray-900'}`}>
                  Your Personal Vegan Nutrition Assistant
                </h2>
                <p className={`text-xl ${darkMode ? 'text-gray-300' : 'text-gray-600'} max-w-2xl mx-auto`}>
                  Track your meals, calculate nutritional needs, and maintain a healthy vegan lifestyle with personalized recommendations.
                </p>
              </div>

              {/* Features Grid */}
              <div className="grid grid-cols-1 md:grid-cols-3 gap-8 w-full max-w-5xl">
                <div className={`${darkMode ? 'bg-gray-800' : 'bg-white'} p-6 rounded-xl shadow-lg`}>
                  <div className="text-green-500 mb-4">
                    <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 7h6m0 10v-3m-3 3h.01M9 17h.01M9 14h.01M12 14h.01M15 11h.01M12 11h.01M9 11h.01M7 21h10a2 2 0 002-2V5a2 2 0 00-2-2H7a2 2 0 00-2 2v14a2 2 0 002 2z"></path>
                    </svg>
                  </div>
                  <h3 className={`text-xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-gray-900'}`}>Calorie Calculator</h3>
                  <p className={`${darkMode ? 'text-gray-400' : 'text-gray-600'}`}>Calculate your daily caloric needs based on your personal metrics and activity level.</p>
                </div>

                <div className={`${darkMode ? 'bg-gray-800' : 'bg-white'} p-6 rounded-xl shadow-lg`}>
                  <div className="text-green-500 mb-4">
                    <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M16 7a4 4 0 11-8 0 4 4 0 018 0zM12 14a7 7 0 00-7 7h14a7 7 0 00-7-7z"></path>
                    </svg>
                  </div>
                  <h3 className={`text-xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-gray-900'}`}>Personalized Tracking</h3>
                  <p className={`${darkMode ? 'text-gray-400' : 'text-gray-600'}`}>Track your daily meals and monitor your progress with detailed nutritional information.</p>
                </div>

                <div className={`${darkMode ? 'bg-gray-800' : 'bg-white'} p-6 rounded-xl shadow-lg`}>
                  <div className="text-green-500 mb-4">
                    <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"></path>
                    </svg>
                  </div>
                  <h3 className={`text-xl font-semibold mb-2 ${darkMode ? 'text-white' : 'text-gray-900'}`}>Progress Analytics</h3>
                  <p className={`${darkMode ? 'text-gray-400' : 'text-gray-600'}`}>View detailed analytics of your nutrition journey with easy-to-understand visualizations.</p>
                </div>
              </div>

              {/* Sign In Button */}
              <div className="mt-8">
                <GoogleLogin onSuccess={handleLoginSuccess} />
              </div>

              {/* Bottom Text */}
              <p className={`text-sm ${darkMode ? 'text-gray-400' : 'text-gray-500'} mt-8`}>
                Join thousands of users who have transformed their vegan lifestyle with our app
              </p>
            </div>
          </main>
        </div>
      </GoogleOAuthProvider>
    );
  }

  return (
    <GoogleOAuthProvider clientId="591276305061-4b3vrn5921v0770c45kvsbb739gb6i1v.apps.googleusercontent.com">
      <div className={`min-h-screen ${darkMode ? 'bg-gray-900' : 'bg-gray-50'} transition-colors duration-200`}>
        <Header />
        <nav className={`${darkMode ? 'bg-gray-800' : 'bg-white'} shadow-sm`}>
          <div className="container mx-auto px-4">
            <ul className="flex space-x-8 py-4">
              <li>
                <Link to="/" className={`${darkMode ? 'text-green-400 hover:text-green-300' : 'text-green-600 hover:text-green-800'} transition-colors`}>
                  Food Search
                </Link>
              </li>
              <li>
                <Link to="/calculator" className={`${darkMode ? 'text-green-400 hover:text-green-300' : 'text-green-600 hover:text-green-800'} transition-colors`}>
                  BMI & Calorie Calculator
                </Link>
              </li>
            </ul>
          </div>
        </nav>
        <main className="container mx-auto px-4 py-8">
          <Routes>
            <Route
              path="/"
              element={
                <ProtectedRoute>
                  <MealTracker 
                    meals={dailyMeals}
                    onAddMeal={handleAddMeal}
                    onRemoveMeal={handleRemoveMeal}
                  />
                </ProtectedRoute>
              }
            />
            <Route
              path="/calculator"
              element={
                <ProtectedRoute>
                  <Calculator />
                </ProtectedRoute>
              }
            />
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </main>
      </div>
    </GoogleOAuthProvider>
  );
}

export default App;
